import logo from './logo.svg';
import pic1 from './pic1.jpeg';
import './App.css';
import $ from 'jquery';


function App() {
  return (
  <>
    <div class="pages">
      <div className="App">

      </div>


      <div className = 'picture'>
        <img id ='picture1' src={pic1} alt="picture1" />
      </div>
    </div>
  </>
  );
}

$(document).ready (function (){


  var one = $('.App').offset().top;
  var two = $('.picture1').offset().top;

  $(window).scroll(function() {

    var currentScroll = $(window).scrollTop();

    if (currentScroll >= 0) {
      $('one').css({
        position: 'fixed',
        top: '0',
      });
    } else {
      $('one').css({
        position: 'static'
      });
    }

    if (currentScroll >= two) {
      $('two').css({
        position: 'fixed',
        top: '2000px',
      });
    } else {
      $('two').css({
        position: 'static'
      });
    }

  });
});

export default App;
